import React from 'react';

import ButtonLight from './buttonLight';
const Card = props =>{
    console.log(props)
    return( 
        <div className="ui link cards">
                <div class="card">
                <div class="image">
                <img src={props.obj.image}/>
                </div>
                <div class="content">
                <div class="header">{props.obj.name}</div>
                <div class="meta"><a>{'Seen in:' + props.obj.seenIn}</a></div>
                <div class="description">
                {props.obj.text}
                </div>
                </div>
                <ButtonLight btnText = "Read More" />
                </div>
        </div>
    );
};

export default Card;
